import React from 'react'

function searchbar() {
  return (
    <div className='text-center'>
        <div className="form">
         <label htmlFor="searchbar" className='text-light'>Find: &nbsp; </label>
            <input type="text" className="form-control w-25 ms-auto" style={{display:"inline",marginLeft:"500px"}} placeholder='Search' id='searchbar'/>
       
        </div>
    </div>
  )
}

export default searchbar
